import React from 'react';

const ExercisesList = ({ exercises }) => {
    return (
        <div>
            {exercises.map((exercises, key) => (
                <div>
                    <h3>Logged Exercises</h3>
                    <table className="table">
                        <thead className="thead-light">
                            <tr>
                                <th>Username {exercises.username}</th>
                                <th>Description {exercises.username}</th>
                                <th>Duration {exercises.username}</th>
                                <th>Date{exercises.username}</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
                            {/* {this.exerciseList()} */}
                        </tbody>
                    </table>
                </div>
            ))}
        </div>
    )
}
export default ExercisesList;
